import React from "react";

function Card (props) {

    function handleClick() {
        props.onCardClick(props.card);
      }

    return (
        <div className="element">
            <img onClick={handleClick} className="element__photo" src={props.card.link} alt="Добавленная фотография" />
            <div className="element__container">
                <h2 className="element__title">{props.card.name}</h2>
                <div className="like_container">
                    <button aria-label="Лайк" className="like-button"></button>
                    <p className="like_counter">{props.card.likes.length}</p>
                </div>
                <button aria-label="Удалить" className="delete-button"></button>
            </div>
        </div>
    )
}

export default Card;
